import React, { useState } from 'react';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';
import app from './firebaseconfig';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';

export default function NutritionT() {
    const [open, setOpen] = useState(false);

    const handleClickOpen = () => {
        setOpen(true);
    };
    
    const handleClose = () => {
        setOpen(false);
    };
        
    return (
        <div>
            <ButtonAppBar />
            <div align="center" alignItems="center" justifyContent="center" display="flex">
                <h2>Nutrition Tracker</h2>
                <Button variant="outlined" color="primary" onClick={handleClickOpen}>
                Open form dialog
                </Button>
                <Button variant="outlined" color="primary" onClick={handleClick}>
                Log out
                </Button>
                <Dialog open={open} onClose={handleClose} aria-labelledby="form-dialog-title">
                <DialogTitle id="form-dialog-title">Enter food details</DialogTitle>
                <DialogContent>
                    <DialogContentText>
                    Please enter the name of the food
                    </DialogContentText>
                    <TextField
                    autoFocus
                    margin="dense"
                    id="name"
                    label="Name of food"
                    type="text"
                    fullWidth
                    />
                    <TextField
                    autoFocus
                    margin="dense"
                    id="name"
                    label="Number of calories"
                    type="text"
                    fullWidth
                    />
                </DialogContent>
                <DialogActions>
                    <Button onClick={handleClose} color="primary">
                    Cancel
                    </Button>
                </DialogActions>
                </Dialog>
            </div>
        </div>
    );
}

const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,
    },
    menuButton: {
      marginRight: theme.spacing(2),
    },
    title: {
      flexGrow: 1,
    },
  }));

function ButtonAppBar() {
    const classes = useStyles();
    return (
      <div className={classes.root}>
        <AppBar position="static">
          <Toolbar>
            <IconButton edge="start" className={classes.menuButton} color="inherit" aria-label="menu">
              <MenuIcon />
            </IconButton>
            <Typography variant="h6" className={classes.title}>
              Nutrition Tracker
            </Typography>
            <Button color="inherit" onClick={() => app.auth().signOut()}>Log Out</Button>
          </Toolbar>
        </AppBar>
      </div>
    );
}
